[[File:Raw chompy detail.png|left|150px]]
A '''raw chompy''' is obtained by killing a [[chompy bird]]. It can be cooked on an [[iron spit]] or ogre spit roast at Rantz house, to make [[cooked chompy]]. Failure to cook it properly will result in a [[burnt food|ruined chompy]]. Raw chompy is one of the three main ingredients in a [[wild pie]].

The ability to hunt chompies is unlocked during the [[Big Chompy Bird Hunting]] quest. They are also used in the quest [[Recipe for Disaster]] during the portion where [[Skrach Uglogwee]] needs to be freed.
